function minSum(nums1: number[], nums2: number[]): number {
    let sum1 = nums1.reduce((acc, val) => acc + val, 0);
    let sum2 = nums2.reduce((acc, val) => acc + val, 0);
    const zeros1 = nums1.filter(val => val === 0).length;
    const zeros2 = nums2.filter(val => val === 0).length;

    if ((zeros1 === 0 && zeros2 === 0) && sum1 !== sum2) return -1;
    if (sum1 === sum2) return sum1;

    const diff = Math.abs(sum1 - sum2);
    const totalZeros = zeros1 + zeros2;
    if (diff % totalZeros === 0) {
        return sum1 > sum2 ? sum1 + zeros2 * (diff / totalZeros) : sum2 + zeros1 * (diff / totalZeros);
    } else {
        return -1;
    }
};
